Cape: Banana Republic | Blouse: Ann Taylor | Necklace: Julie Vos | Jeans: J Brand | Sunglasses: Karen Walker | Watch: The Horse | Ring: Julie Vos | Bag: c/o Nine West Canada | Booties: c/o Nine West Canada {also available here}

The perfect fall day, a light sweater and leopard print accessories: does it get any better than that? The lovely team at Nine West Canada recently sent over two items from their fall leopard print collection. This boxy, oversized bag works great over-the-shoulder or even as a crossbody. And can we talk about these ankle boots? I mean – they’re just too good. And true to form for Nine West – uber comf – which is always a win for cute shoes ;) Be sure to check out these styles and more in store now!

