Sunglasses: Karen Walker | Body Suit Blouse: c/o Honey | Bow Skirt: c/o Honey | Shoes: Zara | Clutch: Aldo | Earrings: Baublebar {similar at Honey}

There’s something about an oversized bow on a tulle skirt that just makes me want to twirl. I met with the fun ladies at Honey in Sherway Gardens a few weeks back for a fun shopping date to get stocked up on all things pink, glittery and girly for fall. Think tulle skirts, cozy sweaters, embellished tees, fun jewels and more. They also carry some amazing brand names like Canada Goose, Paige Denim and more. The new Honey location is stunning and packed from wall to wall with goodies for everyone. Definitely swing by (or visit any of their other locations) and check it out!

Hat: Mango {similar} | Dress: c/o Windsor Store | Jacket: Danier {old, similar} | Bag: Chanel {budget friendly option here} | Shoes: c/o Windsor Store | Watch: The Horse | Cuffs: c/o Brandy Pham

I love the casual-cool factor of this outfit. The length of the dress is perfect for this time of year as it extends past the knee which in my books is enough reason not to need tights unless it’s snowing out. Throw on a moto jacket, fedora and crossbody bag and you’re set for a day at the office or fancy date night with yours truly.

