Sweater: Banana Republic | Blouse: Ann Taylor | Jeans: J Brand | Shoes: Christian Louboutin {Budget Friendly Option} | Bag: Chloe | Watch: The Horse | Pin: Chanel {similar} | Sunglasses: Karen Walker

There was a slight chill in the air before date night this week and this sweater was the outer-layer of choice. I’ve been holding onto it since summer waiting for the perfect opportunity to wear it! I’ve worn it with just a tank and some layered necklaces but I like the preppy vibe you get with a collared shirt under. I can’t wait to get some more wear out of it now that fall has decided to stick around!

