Shop an inspired look from Neiman Marcus:

Beanie | Sweater {similar} | Shirt | Jeans {also love these} | Bag | Earrings | Watch | Boots | Sunglasses

Today I’m sharing a second look with you that shows an inspired look from the all collection at Neiman Marcus. And yes, I am certainly guilty of repeating the colour palette I used when I first wore these jeans. I’m normally a major fan of bold colours, brights and patterns but the past few weeks I’ve found myself resorting to more simpler textures and shades for fall. Ask me about this last year and I would have declared it a rut but I’m secretly falling in love with more of a toned down look for fall. But who knows how long this will last ;) In any event, the minimalist inspired lookbook from the CUSP collection struck a chord with me and this was my personal take on fall’s emerging trends. Do you find yourself inspired to change things up from your normal style routine this season?

